	('kim2509', 1, 'help', '강남 코다차야 술집 대신 줄 서 줄 사람~', '신논현역 5번출구에 코다차야 라는 술집이 있어요. 거기에는 갈 때마다 사람이 너무 많아서... 오늘 저녁 7시에 가야 되는데요. 기다리지 않게 먼저 가서 줄 서 주실수 있을까요?', '', '', '', '37.4704213612', '126.96732417061958', '', '5,000', NULL, NULL, '오늘', '지금', '종료됨', '2014-12-09 00:00:00', NULL),
	('kim2509', 2, 'help', '휴대폰 충전케이블 좀 사다줄 사람', '휴대폰은 갤럭시S3 입니다. 일반 삼성 케이블이면 가능하겠지요. 오늘까지 가능할까요? 제가 6시에 퇴근이니깐 그 전까지 갖다주세요.', '', '', '', '37.475210', '126.963372', '', '3,000', NULL, NULL, '오늘', '지금', '종료됨', '2014-12-22 00:00:00', NULL),
